import React from 'react';
import {FooterBottom, FooterContainer, FooterTop} from "./style";
import {Container} from "../../assets/styles";

const Footer = () => {
    return (
        <FooterContainer>
            <Container>
                <FooterTop></FooterTop>
                <FooterBottom></FooterBottom>
            </Container>
        </FooterContainer>
    );
};

export default Footer;
